import {Routes, Route, Navigate} from "react-router-dom";
import {Home} from '../pages/Home';
import {AllFoouds} from "../pages/AllFoods";
import {Cart} from "../pages/Cart";
import {Checkout} from "../pages/Checkout";
import {Contact} from "../pages/Contact";
import {FoodDetails} from "../pages/FoodDetails";
import {Login} from "../pages/Login";
import {Register} from "../pages/Register";


const Routers = () => {
    return (
        <Routes>
            <Route path='/' element={<Navigate to='/home'/>}/>
            <Route path='/home' element={<Navigate to={<Home/>}/>}/>
            <Route path='/foods' element={<Navigate to={<AllFoouds/>}/>}/>
            <Route path='/foods/:id' element={<Navigate to={<FoodDetails/>}/>}/>
            <Route path='/cart' element={<Navigate to={<Cart/>}/>}/>
            <Route path='/checkout' element={<Navigate to={<Checkout/>}/>}/>
            <Route path='/login' element={<Navigate to={<Login/>}/>}/>
            <Route path='/register' element={<Navigate to={<Register/>}/>}/>
            <Route path='/contact' element={<Navigate to={<Contact/>}/>}/>
        </Routes>);
}

export default Routers;
